import React, {Component} from "react"; 
import "./Jumbo.css";




class Jumbo extends Component {
    render(){
        return (
            <div className="Jumbo">
                <h1 className="Jumbo-title">JP Luncumilla</h1>
            </div>
        )
    }
}

export default Jumbo;
